import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";

import "./HomePage.css";

function HomePage() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  const categories = [
    { name: "Áo thun", slug: "ao-thun" },
    { name: "Áo khoác", slug: "ao-khoac" },
    { name: "Áo polo", slug: "ao-polo" },
    { name: "Quần", slug: "quan" },
    { name: "Phụ kiện", slug: "phu-kien" },
    { name: "Giày", slug: "giay" }
  ];

  useEffect(() => {
    fetch("http://localhost:5000/api/products")
      .then(res => res.json())
      .then(data => {
        if (Array.isArray(data)) setProducts(data);
        else if (Array.isArray(data.products)) setProducts(data.products);
        else setProducts([]);
      })
      .catch(err => console.error(err))
      .finally(() => setLoading(false));
  }, []);

  const addToCart = (product) => {
    const cart = JSON.parse(localStorage.getItem("cart")) || [];
    const existing = cart.find(item => item._id === product._id);
    if (existing) existing.quantity += 1;
    else cart.push({ ...product, quantity: 1 });
    localStorage.setItem("cart", JSON.stringify(cart));
    alert(`Đã thêm "${product.name}" vào giỏ hàng!`);
  };

  const featuredProduct = products[0]; // banner đầu tiên

  return (
    <div className="homepage">
      {featuredProduct && (
        <div className="banner">
          <Link to={`/product/${featuredProduct.slug}`}>
            <img
              src={featuredProduct.images?.[0]?.url || "https://via.placeholder.com/1200x300"}
              alt={featuredProduct.name}
            />
            <div className="banner-info">
              <h2>{featuredProduct.name}</h2>
              <p>{featuredProduct.description}</p>
            </div>
          </Link>
        </div>
      )}

      <div className="main-content">
        <aside className="sidebar">
          <h3>Danh mục sản phẩm</h3>
          <ul>
            {categories.map(cat => (
              <li key={cat.slug}>
                <Link to={`/category/${cat.slug}`}>{cat.name}</Link>
              </li>
            ))}
          </ul>
        </aside>

        <main className="products">
          <h3>Sản phẩm nổi bật</h3>
          {loading ? (
            <p>Đang tải sản phẩm...</p>
          ) : (
            <div className="product-grid">
              {products.map(product => (
                <div key={product._id} className="product-card">
                  <Link to={`/product/${product.slug}`}>
                    <img
                      src={product.images?.[0]?.url || "https://via.placeholder.com/200"}
                      alt={product.name}
                    />
                  </Link>
                  <div className="product-info">
                    <Link to={`/product/${product.slug}`}><h4>{product.name}</h4></Link>
                    <p>{product.basePrice?.toLocaleString()} ₫</p>
                  </div>
                </div>
              ))}
            </div>
          )}
        </main>
      </div>
    </div>
  );
}

export default HomePage;
